import React from 'react'

const Anais = () => {
  return (
    <div className='container'>
      <p className='display-6 mt-4'><strong>Anais</strong></p>
      <p>
        Os anais da Semana Acadêmica de Biotecnologia da UFPel estão disponíveis para consulta. 
        Você pode acessar os anais clicando no botão abaixo.
      </p>
    </div>
  )
}

export default Anais
